INSERT INTO `category` VALUES (5, 'Illustrator CC 2018 Fundamentals For Beginners', 'Learn Illustrator CC 2018 Fundamentals and Enjoy Drawing with Adobe Illustrator CC the 5 Facebook Emoji Projects', 3.2, 55, 3, 'https://res.cloudinary.com/dzyfkhpce/image/upload/v1614042982/Illustrator_CC_2018_Fundamentals_For_Beginners/Illustrator_CC_2018_Fundamentals_For_Beginners_yi7oaq.jpg', 320000.00, 10, '2021-02-23 00:00:00', '2021-02-23 00:00:00', 1, 0, '<p style=\"text-align:start;\"></p>\r\n<p style=\"margin-left:0px;\"><span style=\"background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">Adobe Illustrator is the world\'s leading vector based software, it can be used to create stunning and amazing art. This course teaches you the basics and concepts that can be useful in any kind of project. With Instructor Abdelwahab Achoub you will learn about the necessary tools, pallets and shortcuts, how to deal with swatches and how to use some advanced tools like the arc tool, and the reflection too, and the line segment tool.</span><span style=\"background-color: rgb(255,255,255);font-family: Arial;\"><br></span><span style=\"background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\"><strong>Nothing better to do after learning the concept than applying the knowledge you have gained and creating real world projects.</strong></span><span style=\"background-color: rgb(255,255,255);font-family: Arial;\"><br></span><span style=\"background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">You will be creating 5 projects called the Facebook reaction emoji:</span><span style=\"background-color: rgb(255,255,255);font-family: Arial;\"><br></span><span style=\"background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">-The HAHA Facebook Emoji</span><span style=\"background-color: rgb(255,255,255);font-family: Arial;\"><br></span><span style=\"background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">-The Sad Facebook Emoji</span><span style=\"background-color: rgb(255,255,255);font-family: Arial;\"><br></span><span style=\"background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">-The Angry Facebook Emoji</span><span style=\"background-color: rgb(255,255,255);font-family: Arial;\"><br></span><span style=\"background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">-The WOW Facebook Emoji</span><span style=\"background-color: rgb(255,255,255);font-family: Arial;\"><br></span><span style=\"background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">-The Heart Facebook Emoji</span></p>\r\n<p style=\"text-align:start;\"></p>\r\n<h4 style=\"margin-left:0px;\"><span style=\"background-color: rgb(255,255,255);font-size: 1.4rem;font-family: Arial;\">What you’ll learn</span></h4>\r\n<ul>\r\n<li style=\"margin-left:0px;\"><span style=\"background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">Be comfortable using Adobe Illustrator</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">Creating the Facebook Emoji</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">Use the various tools of Illustrator</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">Create The HAHA Facebook Emoji</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">Create The Sad Facebook Emoji</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">Create The Angry Facebook Emoji</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">Create The WOW Facebook Emoji</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">Create The Heart Facebook Emoji</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">Apply gradients in Illustrator</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">Create Swatches in illustrator</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">Speed up your workflow with shortcuts</span></li>\r\n</ul>\r\n', 16, 1);
INSERT INTO `category` VALUES (6, 'After Effects CC Masterclass', 'Learn After Effects CC to improve your videos with professional motion graphics and visual effects.', 5, 85, 3, 'https://res.cloudinary.com/dzyfkhpce/image/upload/v1614042773/After_Effects_CC_Masterclass/After_Effects_CC_Masterclass_alszvi.jpg', 350000.00, 10, '2021-02-23 00:00:00', '2021-02-23 00:00:00', 1, 0, '<h4 style=\"text-align:start;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: 1.4rem;font-family: sf pro display\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol;\">What you’ll learn</span></h4>\r\n<ul>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: 16px;font-family: sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol;\">Includes CC 2020 Updates!</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: 16px;font-family: sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol;\">You will know how to use After Effects to make your videos better than ever</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: 16px;font-family: sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol;\">You will be comfortable using After Effects - even if you\'re a beginner</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: 16px;font-family: sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol;\">Know how to create a video project from start to finish in After Effects</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: 16px;font-family: sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol;\">Create professional motion graphics that improve your videos</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: 16px;font-family: sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol;\">Add creative visual effects to your video projects</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: 16px;font-family: sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol;\">Export high quality videos from After Effects and know how to use it with Premiere Pro efficiently</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: 16px;font-family: sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol;\">You will have the full support of an instructor who loves teaching</span></li>\r\n</ul>\r\n<h4 style=\"text-align:start;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: 1.4rem;font-family: sf pro display\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol;\">Are there any course requirements or prerequisites?</span></h4>\r\n<ul>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: 16px;font-family: sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol;\">You should have Adobe After Effects installed so you can follow along with the course lessons. We\'ll be using the Creative Cloud version of After Effects, but you can do many of the lessons in a previous version if you don\'t have After Effects CC.</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: 16px;font-family: sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol;\">You DO NOT need any experience with After Effects. This course is for beginners and assumes you don\'t have any experience with the program.</span></li>\r\n</ul>\r\n<h4 style=\"text-align:start;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: 1.4rem;font-family: sf pro display\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol;\">Who this course is for:</span></h4>\r\n<ul>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: 16px;font-family: sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol;\">Anyone looking to use After Effects to improve their videos</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: 16px;font-family: sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol;\">Videographers, video producers, video editors</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: 16px;font-family: sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol;\">Motion graphics artists and graphic designers</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: 16px;font-family: sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol;\">YouTubers and vloggers</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: 16px;font-family: sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol;\">Businesses that use video as part of their marketing strategy</span><span style=\"background-color: rgb(255,255,255);\"> </span></li>\r\n</ul>', 10, 1);
INSERT INTO `category` VALUES (7, 'Complete Javascript Course for Beginners with jQuery AJAX ', 'Learn Javascript from zero to advanced through challenges, exercises and real life projects! 85+ Lessons and 15+ hours!', 4.2, 76, 3, 'data:image/png;base64,', 900000.00, 7, '2021-02-23 00:00:00', '2021-02-23 00:00:00', 1, 0, '<p style=\"text-align:start;\"><span style=\"color: rgb(0,0,0);font-family: Roboto;\"><strong>What you\'ll learn</strong></span></p>\n<ul>\n<li style=\"text-align:start;\"><span style=\"color: rgb(0,0,0);font-size: medium;font-family: Roboto;\">The basics of Javascript from Beginner to Advanced</span></li>\n<li style=\"text-align:start;\"><span style=\"color: rgb(0,0,0);font-size: medium;font-family: Roboto;\">The jQuery Framework</span></li>\n<li style=\"text-align:start;\"><span style=\"color: rgb(0,0,0);font-size: medium;font-family: Roboto;\">AJAX and HTTP Requests</span></li>\n<li style=\"text-align:start;\"><span style=\"color: rgb(0,0,0);font-size: medium;font-family: Roboto;\">Get external data from APIs and Work with JSON format</span></li>\n<li style=\"text-align:start;\"><span style=\"color: rgb(0,0,0);font-size: medium;font-family: Roboto;\">Build dynamic web applications with Javascript</span></li>\n<li style=\"text-align:start;\"><span style=\"color: rgb(0,0,0);font-size: medium;font-family: Roboto;\">The basics of Front End Web Development</span></li>\n</ul>\n', 37, 0);
INSERT INTO `category` VALUES (8, 'React basic in just 1 hour', 'The quick guide to learn basic concepts and workflow of how to build React app', 4.9, 632, 3, 'https://res.cloudinary.com/dzyfkhpce/image/upload/v1614073461/React_basic_in_just_1_hour/React_basic_in_just_1_hour_wcjn9f.jpg', 299000.00, 8, '2021-02-23 00:00:00', '2021-02-23 00:00:00', 1, 0, '<p style=\"text-align:start;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">This short course will cover basic and core concepts that you need to know to get up and running with ReactJS.</span></p>\r\n<p style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">React JS is a Javascript library for building user interfaces. It\'s flexible, fast, easy to learn and fun to work with. ReactJS is designed to make the process of building modular, reusable user interface components simple and intuitive. React was developed at Facebook and focuses on the \'View\' aspect of MVC in web applications. React was built for the purpose of developing applications that are large in nature and have to deal with time changing data.</span></p>\r\n<p style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">Also in this course, it will get you up to speed quickly with easy to follow short videos. It is project-oriented with hands-on examples, from simple to complex, that will help you with the most fundamentals concepts of React:</span></p>\r\n<ul>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">React custom syntax and the JSX transform</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">components, properties and state</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">The power of the virtual DOM</span></li>\r\n</ul>\r\n<p style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\"><strong>Topics include:</strong></span></p>\r\n<ul>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">Compiling JSX to plain JS</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">introduction to Npm react-tools</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">Creating components</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">Using and populating properties</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">Adding and using state</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">Handling events</span></li>\r\n</ul>\r\n<p style=\"margin-left:0px;\"><span style=\"color: inherit;background-color: rgb(255,255,255);font-size: 1.4rem;font-family: Arial;\">What you’ll learn</span></p>\r\n<ul>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">Taste of how to build your very first React component.</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">How to handle event in components.</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">Understand two key concepts of React: State and Props.</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">How to reuse and nest components.</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">How to transfer data between Parent, Child components.</span></li>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">How to work with Array, Form</span></li>\r\n</ul>\r\n<h4 style=\"margin-left:0px;\"><span style=\"color: inherit;background-color: rgb(255,255,255);font-size: 1.4rem;font-family: Arial;\">Are there any course requirements or prerequisites?</span></h4>\r\n<ul>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">Nothing as you will be working on a online code editor so it\'s super convenient.</span></li>\r\n</ul>\r\n<h4 style=\"margin-left:0px;\"><span style=\"color: inherit;background-color: rgb(255,255,255);font-size: 1.4rem;font-family: Arial;\">Who this course is for:</span></h4>\r\n<ul>\r\n<li style=\"margin-left:0px;\"><span style=\"color: rgb(60,59,55);background-color: rgb(255,255,255);font-size: inherit;font-family: Arial;\">Anyone who want to learn React without much knowledge of HTML or CSS.</span><span style=\"background-color: rgb(255,255,255);font-family: Arial;\"> </span></li>\r\n</ul>', 17, 0);

