oboto;\">Có được kiến thức toàn diện về ngôn ngữ lập trình C++, cấu trúc dữ liệu.</span></li>\n<li><span style=\"color: rgb(0,0,0);font-size: medium;font-family: Roboto;\">Có thể tham gia các dự án liên quan tới lập trình C++.</span></li>\n<li><span style=\"color: rgb(0,0,0);font-size: medium;font-family: Roboto;\">Là cơ sở để học tiếp các khóa: lập trình C#, lập trình Java, lập trình Android, Python...</span></li>\n<li><span style=\"color: rgb(0,0,0);font-size: medium;font-family: Roboto;\">Làm chủ được C++ sẽ giúp học viên dễ dàng tiếp thu các ngôn ngữ mới.</span>&nbsp;</li>\n</ul>\n', 0.00, 3, '2021-01-31 10:00:00', 'KyFlKdTOedwQedarHqgTuOpXOi5yPFzR', '0327247666', '173097', b'1', 1);
